import React from "react";
import Typed from "react-typed";
import logo from "../me.jpg";
import social from "../294671_linkedin_icon.png";
import social2 from "../4691413_netlify_icon.png";
import social3 from "../291716_github_logo_social network_social_icon.png";

const Landing = () => {
  return (
    <div className="header-wraper">
      <div className="main-info">
        <h1>React Developer</h1>
        <Typed
          className="typed-text"
          strings={[
            "React Developer",
            "Cloud Computing",
            "Technical Program Manager",
          ]}
          typeSpeed={40}
          backSpeed={60}
          loop
        />
        <img className="logo" src={logo} alt="logo...." />
            <img className="social2" src={social2} alt="logo...." />
              <img className="social3" src={social3} alt="logo...." />
        <a href="https://www.linkedin.com/in/murial-anindo/" className="btn-main-offer">
         Contact Me   <img className="social" src={social} alt="logo...." />
        </a>
      </div>
    </div>
  );
};

export default Landing;
